package day049;

public class Do_while {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i=100;
		
		do {
			System.out.println("적어도 한번은 툴력되는 문장"); //반복은 하지만 최소한 한번은 출력이 됨 참 과 거짓의 여부는 관계없음
		}	while (i<10); 

		System.out.println("이것은 와일");		
		
		
		System.out.println("프로그램종료");
		

	}

}
